function easeOutElastic(x){const c4=2*Math.PI/3;return 0===x?0:1===x?1:Math.pow(2,-10*x)*Math.sin((10*x-.75)*c4)+1}function easeLinear(x){return x}function easeInOutCubic(x){return x<.5?4*x*x*x:1-Math.pow(-2*x+2,3)/2}function easeOutBack(x){const c1=1.70158,c3=c1+1;return 1+c3*Math.pow(x-1,3)+c1*Math.pow(x-1,2)}function easeOutExpo(x){return 1===x?1:1-Math.pow(2,-10*x)}function easeInOutExpo(x){return 0===x?0:1===x?1:x<.5?Math.pow(2,20*x-10)/2:(2-Math.pow(2,-20*x+10))/2}function easeInOutSine(x){return-(Math.cos(Math.PI*x)-1)/2}function easeInCirc(x){return 1-Math.sqrt(1-Math.pow(x,2))}function easeInOutCirc(x){return x<.5?(1-Math.sqrt(1-Math.pow(2*x,2)))/2:(Math.sqrt(1-Math.pow(-2*x+2,2))+1)/2}function array_shuffle(array){for(let i=array.length-1;i>0;i--){let j=Math.floor(Math.random()*(i+1));[array[i],array[j]]=[array[j],array[i]]}}function array_unique(value,index,self){return self.indexOf(value)===index}